import { Link } from "react-router-dom";
import styles from './index.module.css';
import pathfinder from './PathfindingVisualizer/PathfindingVisualizer';


const MainPage = () => {
    return (

        <body class={styles.bodystyle}>
            {/* <div class={styles.whole}> */}
            <h1>Dijkstra's Pathfinding Visualizer</h1>
                <div class={styles.container}>
                    <button class={styles.button1} onClick={pathfinder}></button>
                    <button class={styles.button2}> <Link class={styles.link} to="/pathdragon"></Link></button>
                </div>
            {/* </div> */}
        </body>
    )
};

export default MainPage;
